import { Navigate, Route, Routes } from "react-router";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Navigate to="/welcome"> </Navigate>}></Route>
        <Route path="/quotes" element={<h1>Home</h1>}></Route>
        <Route path="/quotes/:quoteId" element={<h1>welcome</h1>}></Route>
        <Route path="/newQuote" element={<h1>Product</h1>}></Route>
      </Routes>
    </div>
  );
}

export default App;
